import React from 'react'
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';

const useStyles = makeStyles({
    root: {
      maxWidth: 345,
    },
  });
  const statData = [
    {
      title: "AWS",
      description: "AWS description",
      image: require("../Images/blank-business-composition-computer-373076.jpg"),
    },
    {
      title: "GCP",
      description: "GCP description",
      image: require("../Images/pexels-pixabay-267350.jpg"),
    },
    {
      title: "GitHub Actions",
      description: "Github description",
      image: require("../Images/pexels-peter-cors-360438.jpg"),
    },
    {
      title: "SAMPLE",
      description: "Sample",
      image: require("../Images/&b1_logo.png"),
    },
  ];
export default ()=>{
    const classes = useStyles();
    const settings = {
        slidesToShow: 3,
      };
    return(
        <Card {...settings} className={classes.root}>
      <CardActionArea>
        <CardMedia
          component="img"
          alt="Contemplative Reptile"
          height="140"
          image="/static/images/cards/contemplative-reptile.jpg"
          title="Contemplative Reptile"
        />
        <CardContent>
          <Typography gutterBottom variant="h5" component="h2">
            Lizard
          </Typography>
          <Typography variant="body2" color="textSecondary" component="p">
            Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging
            across all continents except Antarctica
          </Typography>
        </CardContent>
      </CardActionArea>
      <CardActions>
        <Button size="small" color="primary">
          Share
        </Button>
        <Button size="small" color="primary">
          Learn More
        </Button>
      </CardActions>
    </Card>
    )
}
